from heapq import heappush, heappop

def minPath(grid, k):
    N = len(grid)
    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    heap = []

    # Initialize heap with all possible starting positions and their values
    for i in range(N):
        for j in range(N):
            # Instead of using cost, use the path as the key for the heap to maintain lexicographical order
            heappush(heap, ([grid[i][j]], i, j))

    while heap:
        path, x, y = heappop(heap)
        if len(path) == k:
            return path

        for dx, dy in moves:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                # Create a new path including the neighbor cell
                newPath = path + [grid[nx][ny]]
                heappush(heap, (newPath, nx, ny))

