        return False
    extended_a = a + a  # To handle cyclic patterns
    b_len = len(b)
    # Iterate through each possible start position of `b` in `extended_a`
    for i in range(len(a)):
        # Check if any rotation of `b` is a substring of `extended_a` starting from index `i`
        if all(extended_a[i+j] == b[j] for j in range(b_len)):
            return True
        for j in range(1, b_len):  # Try all rotations of `b`
            rotated_b = b[j:] + b[:j]
            if extended_a.startswith(rotated_b, i):
                return True
    return False

