def minPath(grid, k):
    from heapq import heappush, heappop

    N = len(grid)
    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    pq = []

    # Create a mapping of grid values to their positions for direct access
    value_to_pos = {}
    for i in range(N):
        for j in range(N):
            value_to_pos[grid[i][j]] = (i, j)

    # Start from the smallest value in the grid, which is always 1
    start_pos = value_to_pos[1]
    heappush(pq, ([1], start_pos))  # (path as list of values, current position)

    while pq:
        path, (x, y) = heappop(pq)
        if len(path) == k:
            return path

        for dx, dy in moves:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N and (len(path) < k or grid[nx][ny] < path[-1]):
                # Only extend the path if doing so won't exceed k or if the next value is smaller
                # than the last value in the current path (to ensure lexicographical order)
                new_path = path + [grid[nx][ny]]
                heappush(pq, (new_path, (nx, ny)))

