            if char == '(':
                open_brackets += 1
            else:
                close_brackets += 1

    # If total open and close brackets are not equal, it's not possible to form a good string
    if open_brackets != close_brackets:
        return 'No'

    # Ensure that at any point, closing brackets do not outnumber opening brackets in the combined string
    for s in [str1 + str2, str2 + str1]:
