from heapq import heappush, heappop

def minPath(grid, k):
    N = len(grid)
    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    heap = []
    for i in range(N):
        for j in range(N):
            heappush(heap, ([grid[i][j]], 1, i, j))  # Push initial positions with their path values, step count, and coordinates

    visited = set()

    while heap:
        path_values, steps, x, y = heappop(heap)
        if (x, y, steps) in visited:
            continue
        visited.add((x, y, steps))

        if steps == k:
            return path_values

        for dx, dy in moves:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                # Create a new path with the value of the next cell and increment steps
                new_path_values = path_values + [grid[nx][ny]]
                heappush(heap, (new_path_values, steps + 1, nx, ny))

