                last = stack.pop()
                # Check for nested condition: a bracket must be followed by another opening
                # bracket in the stack to be considered nested.
                if stack:
                    return True
            else:
                # Unmatched closing bracket immediately means it's not valid
                return False
    # If the stack is empty, all brackets were matched but doesn't guarantee nesting
    # If the stack is not empty, there are unmatched opening brackets, also invalid
    return False

