def minPath(grid, k):
    from itertools import product
    N = len(grid)
    # Convert grid values to positions for O(1) access
    value_to_pos = {grid[x][y]: (x, y) for x, y in product(range(N), repeat=2)}
    # Sort grid values to ensure lexicographical ordering
    sorted_values = sorted(value_to_pos.keys())

    # Dynamic programming table, dp[i][j][l] stores the minimum path of length l starting from cell (i, j)
    dp = [[[[] for _ in range(k + 1)] for _ in range(N)] for _ in range(N)]

    for length in range(1, k + 1):
        for value in sorted_values:
            x, y = value_to_pos[value]
            if length == 1:
                dp[x][y][length] = [value]
            else:
                # Check all 4 possible directions
                for dx, dy in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                    nx, ny = x + dx, y + dy
                    if 0 <= nx < N and 0 <= ny < N and dp[nx][ny][length - 1]:
                        candidate_path = dp[nx][ny][length - 1] + [value]
                        if not dp[x][y][length] or candidate_path < dp[x][y][length]:
                            dp[x][y][length] = candidate_path

    # Find the lexicographically smallest path of length k
    min_path = []
    for x, y in product(range(N), repeat=2):
        if dp[x][y][k] and (not min_path or dp[x][y][k] < min_path):
            min_path = dp[x][y][k]

    return min_path

