def minPath(grid, k):
    from heapq import heappush, heappop
    N = len(grid)

    # Initialize the priority queue with tuples of (path value list, current position, path length)
    pq = []
    for i in range(N):
        for j in range(N):
            heappush(pq, ([grid[i][j]], (i, j), 1))

    visited = set()

    while pq:
        path, (x, y), length = heappop(pq)
        if length == k:
            return path
        if (x, y, length) in visited:
            continue
        visited.add((x, y, length))

        for dx, dy in [(0, 1), (1, 0), (-1, 0), (0, -1)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                new_path = path + [grid[nx][ny]]
                heappush(pq, (new_path, (nx, ny), length + 1))

