def minPath(grid, k):
    from heapq import heappush, heappop

    N = len(grid)
    min_val = min(min(row) for row in grid) # Find the minimum value in the grid
    min_locations = [(i, j) for i in range(N) for j in range(N) if grid[i][j] == min_val]

    # Directions for moving to neighbor cells
    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]

    def neighbors(x, y):
        for dx, dy in moves:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                yield nx, ny

    # Initialize the heap with all possible starting positions of the minimum value
    # Each heap element is a tuple (path_cost, current_x, current_y, path_taken)
    heap = []
    for x, y in min_locations:
        heappush(heap, ([min_val], x, y))

    while heap:
        path, x, y = heappop(heap)
        if len(path) == k:
            return path
        for nx, ny in neighbors(x, y):
            newPath = path + [grid[nx][ny]]
            # Only consider paths where we alternate between the minimum value and any other value
            if len(newPath) <= k and (len(newPath) == 1 or newPath[-2] == min_val or newPath[-1] == min_val):
                heappush(heap, (newPath, nx, ny))

