def minPath(grid, k):
    N = len(grid)
    dp = {(i, j): [[grid[i][j]]] for i in range(N) for j in range(N)}
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]

    for step in range(1, k):
        new_dp = {}
        for i in range(N):
            for j in range(N):
                for di, dj in directions:
                    ni, nj = i + di, j + dj
                    if 0 <= ni < N and 0 <= nj < N:
                        for path in dp[(ni, nj)]:
                            new_path = path + [grid[i][j]]
                            if (i, j) not in new_dp or new_path < new_dp[(i, j)][0]:
                                new_dp[(i, j)] = [new_path]
                            elif new_path == new_dp[(i, j)][0]:
                                new_dp[(i, j)].append(new_path)
        dp = new_dp

    min_path = min([path[0] for path in dp.values()])
    return min_path

