    for num in l:
        if -num in seen:
            return True
        seen.add(num)
    return False

def change_base(x: int, base: int) -> str:
    if x == 0:
        return "0"
    digits = []
    while x:
        digits.append(str(x % base))
        x //= base
    digits.reverse()
    return ''.join(digits)

def median(l: list):
