def get_row(lst, x):
    """
    Given a 2D list `lst` and an integer `x`, find all occurrences of `x` in `lst`,
    and return a list of tuples representing their coordinates in the format (row, column).
    The coordinates are sorted first by row in ascending order, then by column in descending order.
    """
    result = []
    for i, row in enumerate(lst):
        for j, value in enumerate(row):
            if value == x:
                result.append((i, j))
    result.sort(key=lambda x: (x[0], -x[1]))
    return result

