def encrypt(s):
    """Encrypts the input string by shifting letters down by 4 places."""
    encrypted = ''
    for char in s:
        if 'a' <= char <= 'z':
            encrypted += chr((ord(char) - ord('a') + 4) % 26 + ord('a'))
        elif 'A' <= char <= 'Z':
            encrypted += chr((ord(char) - ord('A') + 4) % 26 + ord('A'))
        else:
            encrypted += char
    return encrypted

