def count_nums(arr):
    def sum_of_signed_digits(num):
        # Convert the number to a string for iteration
        num_str = str(num)
        # Initialize the sum of digits
        digit_sum = 0
        # Iterate over each character in the string representation of the number
        for char in num_str:
            # Check if the character is a digit (this automatically skips the '-' sign for negative numbers)
            if char.isdigit():
                # Add the digit to the sum
                digit_sum += int(char)
        # If the original number was negative, subtract twice the value of the first digit to account for the negative sign
        if num < 0:
            digit_sum -= 2 * int(num_str[1])
        return digit_sum

    # Use the sum_of_signed_digits function to filter and count the numbers in the array
    return sum(1 for num in arr if sum_of_signed_digits(num) > 0)

def encode(message):
    vowels = {'a': 'c', 'e': 'g', 'i': 'k', 'o': 'q', 'u': 'w', 'A': 'C', 'E': 'G', 'I': 'K', 'O': 'Q', 'U': 'W'}
    return ''.join(vowels.get(c, c).swapcase() if c.lower() in vowels.keys() else c.lower() for c in message)

def starts_one_ends(n):
    """
    Given a positive integer n, return the count of the numbers of n-digit
    positive integers that start or end with 1.
    """
    if n == 1:
        return 1
    else:
        # Count for numbers starting with 1: 10^(n-1)
        # Count for numbers ending with 1: 10^(n-1)
        # Subtract overlap (numbers starting and ending with 1): 10^(n-2)
        return 2 * 10 ** (n - 1) - 10 ** (n - 2)

