def prod_signs(arr):
    if not arr:
        return None
    sign_product = 1
    magnitude_sum = 0
    for num in arr:
        sign_product *= (1 if num > 0 else -1 if num < 0 else 0)
        magnitude_sum += abs(num)
    return magnitude_sum * sign_product

def digits(n):
    product = 1
    has_odd = False
    for digit in str(n):
        if int(digit) % 2 != 0:
            has_odd = True
            product *= int(digit)
    return product if has_odd else 0

