from heapq import heappush, heappop

def minPath(grid, k):
    n = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    # PriorityQueue item: (path as list, last cell's value, x, y, steps)
    pq = []
    for i in range(n):
        for j in range(n):
            heappush(pq, ([grid[i][j]], grid[i][j], i, j, 1))

    while pq:
        path, _, x, y, steps = heappop(pq)
        if steps == k:
            return path
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < n and 0 <= ny < n:
                newPath = path + [grid[nx][ny]]
                heappush(pq, (newPath, grid[nx][ny], nx, ny, steps + 1))

def match_parens(lst):
    str1, str2 = lst
    # Calculate the net balance and minimum balance of open and close parentheses in both strings
    balance1, min_balance1 = 0, 0
    balance2, min_balance2 = 0, 0

    for char in str1:
        if char == '(':
            balance1 += 1
        else:
            balance1 -= 1
        min_balance1 = min(min_balance1, balance1)

    for char in str2:
        if char == '(':
            balance2 += 1
        else:
            balance2 -= 1
        min_balance2 = min(min_balance2, balance2)

    # Check if overall balance is zero, indicating potential for a balanced string
    if balance1 + balance2 != 0:
        return 'No'

    # Ensure that the first string does not go into a negative balance if it starts first
    if min_balance1 >= 0 or min_balance1 + balance2 >= 0:
        return 'Yes'

    # Ensure that the second string does not go into a negative balance if it starts first
    if min_balance2 >= 0 or min_balance2 + balance1 >= 0:
        return 'Yes'

    return 'No'

