def tri(n):
    if n == 0:
        return [1]
    elif n == 1:
        return [1, 3]
    trib = [1, 3]
    for i in range(2, n + 1):
        if i % 2 == 0:
            trib.append(1 + i // 2)
        else:
            trib.append(trib[i - 1] + trib[i - 2] + trib[0] if i == 3 else trib[i - 1] + trib[i - 2] + trib[i - 3])
    return trib

