                return False
        return True

    def fib():
        a, b = 0, 1
        while True:
            yield a
            a, b = b, a + b

    count = 0
    for fib_num in fib():
        if fib_num > 1 and is_prime(fib_num):
            count += 1
            if count == n:
                return fib_num

