def f(n):
    """ Returns a list of size n, with factorial values for even indexes and sum of numbers for odd indexes. """
    def factorial(x):
        if x == 0:
            return 1
        else:
            return x * factorial(x-1)

    def sum_numbers(x):
        return sum(range(1, x+1))

    result = []
    for i in range(1, n+1):
        if i % 2 == 0:
            result.append(factorial(i))
        else:
            result.append(sum_numbers(i))
    return result

