    vowels = {'a': 'c', 'e': 'g', 'i': 'k', 'o': 'q', 'u': 'w', 'A': 'C', 'E': 'G', 'I': 'K', 'O': 'Q', 'U': 'W'}
    return ''.join(vowels[c] if c in vowels else c.swapcase() for c in message)

def sort_array(arr):
    """
    Sorts an array of non-negative integers based on the number of ones in their binary representation,
    then by their decimal values if the number of ones is the same.
    """
    return sorted(arr, key=lambda x: (bin(x).count('1'), x))

def select_words(s, n):
    """
    Given a string s and a natural number n, this function returns a list of all words from string s that contain exactly n consonants.
    """
    def consonant_count(word):
        return sum(1 for char in word.lower() if char in "bcdfghjklmnpqrstvwxyz")

    return [word for word in s.split() if consonant_count(word) == n]

def get_odd_collatz(n):
    """
    Given a positive integer n, return a sorted list that has the odd numbers in collatz sequence.
    """
    odd_numbers = []
    while n != 1:
        if n % 2 == 1:
            odd_numbers.append(n)
        n = 3*n + 1 if n % 2 else n // 2
    odd_numbers.append(1)  # Adding 1 at the end, as it's always part of the sequence
    return sorted(odd_numbers)

def valid_date(date):
    # Check if the date is in the correct format
    if len(date) != 10 or date[2] != '-' or date[5] != '-':
        return False

    parts = date.split('-')
    if len(parts) != 3:
        return False

    month, day, year = parts

    # Check if year, month, and day are digits
    if not (year.isdigit() and month.isdigit() and day.isdigit()):
        return False

    month = int(month)
    day = int(day)
    year = int(year)

    # Check if the month is valid
    if month < 1 or month > 12:
        return False

    # Check if the day is valid
    if day < 1:
        return False
    if month in [1, 3, 5, 7, 8, 10, 12] and day > 31:
        return False
    elif month in [4, 6, 9, 11] and day > 30:
        return False
    elif month == 2 and day > 29:
        return False

    return True

def is_sorted(lst):
    for i in range(len(lst) - 1):
        if lst[i] > lst[i + 1]:
            return False
        if lst.count(lst[i]) > 2:
            return False
    return True

def prod_signs(arr):
    if not arr:
        return None
    sign_product = 1
    magnitude_sum = 0
    for num in arr:
        sign_product *= (1 if num > 0 else -1 if num < 0 else 0)
        magnitude_sum += abs(num)
    return magnitude_sum * sign_product

def digits(n):
    product = 1
    has_odd = False
    for digit in str(n):
        if int(digit) % 2 != 0:
            has_odd = True
            product *= int(digit)
    return product if has_odd else 0

