def intersection(interval1, interval2):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    start1, end1 = interval1
    start2, end2 = interval2
    start = max(start1, start2)
    end = min(end1, end2)
    if start > end:
        return "NO"
    length = end - start
    return "YES" if is_prime(length) else "NO"

def match_parens(lst):
    str1, str2 = lst
    # Calculate net open parentheses for both strings
    net1 = str1.count('(') - str1.count(')')
    net2 = str2.count('(') - str2.count(')')

    # Early return if total balance is off
    if net1 + net2 != 0:
        return 'No'

    # Check if any string starts with more closing than opening parentheses
    # which cannot be balanced by the other string if it follows the same pattern
    min_balance_str1 = min_balance_str2 = 0
    balance = 0
    for char in str1:
        if char == '(':
            balance += 1
        else:
            balance -= 1
        min_balance_str1 = min(min_balance_str1, balance)

    balance = 0
    for char in str2:
        if char == '(':
            balance += 1
        else:
            balance -= 1
        min_balance_str2 = min(min_balance_str2, balance)

    # If the minimum balance of one string can be offset by the net of the other, it's possible to balance
    if min_balance_str1 + net2 >= 0 or min_balance_str2 + net1 >= 0:
        return 'Yes'
    else:
        return 'No'

