def minPath(grid, k):
    from heapq import heappush, heappop

    N = len(grid)
    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    # Create a map from grid values to their coordinates for quick lookup
    value_to_pos = {grid[i][j]: (i, j) for i in range(N) for j in range(N)}

    # Priority queue; stores tuples of (path as a list, last value in path, length of path)
    heap = []

    # Initialize the heap with all possible starting positions
    for value, (x, y) in value_to_pos.items():
        heappush(heap, ([value], value, 1))

    while heap:
        path, last_value, path_len = heappop(heap)
        if path_len == k:
            return path

        # Get the current position from the last value in the path
        x, y = value_to_pos[last_value]

        for dx, dy in moves:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                new_value = grid[nx][ny]
                # Create a new path with the neighbor added
                new_path = path + [new_value]
                # Check if we should continue with this path
                if len(new_path) <= k:
                    heappush(heap, (new_path, new_value, len(new_path)))

