def cycpattern_check(a, b):
    if len(b) > len(a):
        return False
    extended_a = a + a
    # Create all rotations of b and check if any rotation is in the extended_a
    return any(b[i:] + b[:i] in extended_a for i in range(len(b)))

def tri(n):
    if n == 0:
        return [1]
    elif n == 1:
        return [1, 3]
    elif n == 2:
        return [1, 3, 2]
    trib = [1, 3, 2]
    for i in range(3, n + 1):
        if i % 2 == 0:
            trib.append(2 + (i // 2))
        else:
            trib.append(trib[i - 1] + trib[i - 2] + trib[i - 3])
    return trib
